̷̢̡̢̼̗̥̼̲̭̗̺̘̬̟̻̣̪̪̩̞͉̄̄̈́̉͑̓̈͛̑͋̆̈̓̉͆̚̕ͅ ̸̧͓͔͕̩͛̆̉̌̀̄̎͐̎̐͒̍́̉̚̕͠ ̷̗͔̺͉̹̫̥͛́͐͌̾̽̋͋̀̾͌̉͒̃̉͂̌̐͘͜͝͝ ̶̔͋̏͠ͅ ̸̧̲͓̿͛͊̀̈̿̉́̓̅͐́ ̸̛̹̠̼͕̪͈̺̤̠̜̝̪͈͑̍̾̐͛̓̔͋͌̓̚͝ͅͅ ̸̯͔̖̠͓̠͎̙̔ ̷̲̖̣͇͓̳̤̭̗͍͎̺̹̠́͑̿͝ ̷̛̛͖͗̀̆̎̽͛̔̌̀̊͘ ̷̝͓̭͉̠̮̰̠͔͐̏́͛͂̍̈́̈́́̀͊͜ ̷̧̡̼̫̯̭͈̼̩̲̻̙͚̩̹͇̬̙̤͔̎͗͗͆̄̌̓̈̽̒̕ ̶̡̓̓͌͋̔̂̆͝͝͝ ̴̢̢̨̲͎̗͈̝̠̟͇̝͇͚̺͓̦̙̹̥͎̇̀̄̈̔̓̂̏̒́̒̍͛̂̌̐̚͘͜͝ ̶̺̈́̐̓̊̍͛͂̈́͆͌͝͠ ̸̗̼̽̓ ̵̢̣͇̰̪͇̳͖͇̭̫̰̬͔̞̮̆͝ͅͅ ̸̧̢̫͉̰̥̥͚͇͇̭͈͖̬̣̜̟̱̻͓̐́́̈́̓̃͗̀̈͆̎̈́͊͐̏̕̚͜͝ͅ ̴̧̘͚̭̲̰̻͂͊͊̊̆̐̈́̈͊̓ ̸̡̧̼̜̜̦̣̫̠̱̼̻̟̺̪̤͍̭̬̲̑̿̚ ̸̡͙̙̣̭͉̪̤͐̈̐͊̈̽͑̄̽͝͝͠ͅ[̴͔̱̯̜̭͉̫̥͈̣͓̲̻͚̈̓̀́͑̾̒̎̀̾̕͘͜"̸̡̧̡̝̦̻̙͔̘̣̦͈̥͊̈͑̈́̀̿̂̆͝͝n̵̢̢̧͖̻͔̦̤̱̩̮̮̱̱͇͆͆̅̊̂͑̽̂̒͐͆͊̿̔̎̋̂̚͘̕͜͝ä̶͖̬̥̦̦͈̳̰̩̟̺̺͕̟̬̘͚̀́̊̃̐̓͂̆̎͆̐̕͜͜ͅm̷̢̮̠̬͈͉̻͕̓͋͒̅̚͝e̷̡̛̞̼̯͉̻͈̣͕͈̻̘̠͈̮͋̽̅͋̉̂͂̽̍͂̚ͅͅͅ"̸̧̠̦̮̹̤̲̎̿͋͛̓̾̈́̃̈́̊̄̿͘͝]̵̘̭̻̮͔͍͙̺̝͓͔͓͖̅͋͆́̾̄̚ ̶̢͈͚̼͇͊̓̌̎͋́̑̉͌̃́̀̽̕͘͠͠͝ͅ=̷̨̛͈̖͚͚̲̭̝̲̗̝̦̮̅͆͆͋̈́̀̓́͆̄͆͊́̕̚͠ ̵̩̱͈̞̗͔̣͍̠̖̮̠͋́̉̌̽̅͑̍͂̈́̇̽"̶̺͑̈́̅͐̍̅̃̀̑̂͝͝ا̵̧̨͓͖̠̦̹̻̜̌̓̔̓́̈́̈́ل̶̢̡̡̧̛͍̼͍̦͖̭̭̬͍̻̳͎̤̭̱̠̬̜̀̈́̆̈́͑̐͒̉̐́̈́̌̏̈́͑̇͛̉͘̕͝ا̶̛̩͚̂̄̾̓̓س̴̧̡̲̮͙̤͇̳̜̳̭̩̫̥̣̲̪͉̈́̎́͂̿͊̀͝م̶̛̤̘̻͇͔̣̖̰͎͕̗̩̿̇̉̂̃̒̃̀̈́͝͠"̷̧̡̢̨̩͓̳̗̜̲͒̀̓̉̈́͒͛̕͝,̷̡̣̼̞͔̙͚̼͚̻̖̰̲͇̦̙̻̣̖͗̈́̃̈́͌͂͑͊͆̃̌͂͛̾̎̕͝
̶̨̡͉̮̰͚̝͔͇̞͇̙͇̜͎̎͂̾̂͐̏̋́̕͝͠ ̵̢̢̢̛͚̘̱̣̹̞̮͙̬̫̞̼̈̀̊̓̃̚͝ͅ ̶̢̢̥̻͈̙͉̫̖̩̜̜͕̱̼̞̣̟̀͊̍̆̇̂̈́̔̃̔̾̿̔̿̒͂̉̓̊̈́̀͘͜ ̸̡̤͇̖̠̦̭̼̖̯̠̺̞̜̽͌͒̾͜͝ͅ ̴̛͈͑̽̽͗̋͋̽̀̑̂̈́̓͑͆̆̊̓̚̕͠ ̶̘̲̰̣̗͚̙͛̓̅̃̂ ̸͉͖̙̲͕̊̋͑̉̿̏͂͂̂͌͛̏͊̀̈́̀͗̊́̈̈͝ ̵̹̖̠̪̘͓͕̝̗̼́͑̈́͗͆̄̔̇̈́ ̴̡̙̺̗̱͉̮̋̄̈́ ̸̡̨̯̠̟͙͈̦̫͔̠̃̒̾̒̿̐̎͂͑́̂̆̽̈́̒͊͗̄͜͝ͅ ̶̨̨͕̖̘̯̼̼͙̜͉̺͔͈͈̹͓̺̺̲̏̀͂͆̋̄̉̅̉͌̋͘͝ͅͅ ̷͚̱͍̱̖̗̺̳̭̗̗̞͎̗̮̭͔̼̲̖̈́̀̑͝ͅ ̸̧̡̡̛̪͇̝̹̝͕̤͉͍͈̤̣̮͉͚͈͈̻̈̍̄̆́̈́͗̏̈́̔̉̔͑̕͘͠͠ ̵̛͓͓̦̖͙̦̯̲̣̈́͊̇͛͛̑͋̆̒̀̌̓͘̕̕͘̚͝͝ ̷̨̡̛̛̪̳͕͍̟̲̲͖̬̹̭͙̫̜̤̻͂̓͌̿̌͗͊͘͜ͅ ̷̛̦̲̤̺̖̺͙̮̺͛̾͐͛̆̒́̐̈́̉͂̒̚͠͝ͅ ̴̻̪͊͊̾̍͂ ̴̢̛͚̱̱̀̏͑̎̄̇̑͒̉͘̕͝͝͠͝ ̶̬̗̱̹̺̪͚̘̓̒̊̄̔̅̓̈́̅̏͛̑̚͠͝͠͠ͅ ̷̡͚͍̤̦̥̩͕̑̏̃̅̈́́̋̋͑̉̓̊̚̚͠[̷̗̟͑̆̽"̵̢̟͓̼͇̠̖͒̽̈́͛͆̈́̀̍̌̒͗̿̎̿͆̊̑̀̇̽̽͘ͅv̸̛̦̥̯͔̼͍̠͍̗̜̬͉̯̿͋̂̉̄̏̌̽͒̒̈͂́͑̀́̓͜͠͠͝ą̷̧̻͕̞̹͍̱̬̬̜͔̟͔͇̫̠͚̾̍͂̇͠ḻ̴̛̆̂͐̈́̈̆͒̌̾̂̏́͊̅͒̾̇͌̚̕̚ų̸̢̛̠̗͓̖͖͙̱͙͉̠͕͍̮̩̳̥̯̻̐͗͌̃́̍̏̿͛̊͘̕̕͝e̶̡̫̯̬͇̼̦̥̮̳͎̫͐̇͗̾͒͜"̷̧̨̡̨̡̠͇̪̠̺͖͖͉̘̬̜̙͕̟͍̪̍̀̄̿̔̿̊͐̌̋̏͝͝]̴̨̡̞͕͙͇̝̥̲̦̳̲͉͎͎̻̦̋̈́̊̀̅̀͊͝͝͠ ̵̢̘͙͇̻̠̲̤̥̜̖̙̳̠̓̍͊͐͂͂͑̔=̷̡͈͚̘̩̜͚͍̭̻̻͒͆̂̈͛̃̽͒̑́̽͐̈́͜͝͠͝ ̷̠̯̩̈̌̎̉͒̈́͂́͒̐͑͊͠͠"̸̞̖͆̒̇͑̏̌̕̕͝͝|̶̢̨̨̡̫̙̰͚̠̯̣̰̹̰̻̭̂́͗̈́̚̕͜|̵̮̰͍̲̦̦̫̘̲̠̥̼͍͇̗̓̓̾̀"̷̢̪͚̫͔̯̊̆́̒̌̌̈́̏͑̓̋͒̍͊͘.̵̡̨̨̢͚̻̩̼̮̻̺̬̄̂̓͒̏̈́̐̆͊̉̅͋̅̇͑̿̍͆̾̓͠.̵̨̨͓̦͈͓̖̮̭̻̹̝̱̦̻̯̙͉̹̙̜͊͋̈́̇͌̌̊̏̓͊̒͝͝p̷͔͇͙̈́̂̌̃͌̓͐̌̍̃̍̈́͊̆̊̈́̽̅͝l̴̹̺̻̹̮̖̣͊̽̍̐̌̄̔́͋̌̔͆̓̓̒͆̐̀̕á̴̻̩̲̻͙̯͚̣̑͜ỳ̵̡̢͈̥̟̬̦͔̤͚̣͇͇͕̰̌̎͆̇͌̊͜͝͝͠e̵̟͖̮͑͑͒̋̓͘͘͝ŗ̷͍̭̭̤̯̲̰̠͕̦̭̂̈́̈́̐͂̓́̊̈̎̽̈́̂̓͘̚͝.̴̛̩͚̣͔̝̭̗͔͕̭͍̠̤̻̫̂̒̌͂̈͗̀̽̓̒͂̚Ņ̴̡̡̣͎̰̰̦͖̤͔̝͔̣͙̠͓̲̯̊̈́͋͊͊͛̓̽̃̍̓͛̐̾̓͘a̵̡̢̧̮̙̮͖͙̰̜̭̥̰̱͈͍͍̳͎̖͙̅̾̇̓̒̑̀̂̊̍̀̆̓͐̎̏̓͘͘̕̕͠m̴̡̡̧̻͉͎͓̣̲͕̗̖̣͇̬̳̪̊̕ȩ̴̧̜̝͖̲͔͈̣̠̻̙̗̰̭̭̖̲̯̹̓̋̈́̂̀̽̀̑̄̾̚ͅ.̸̢̖̆̆͐̉̈̂͒̊́̚.̶̘̲͈̫͂͋̀͐̄͐͐̈̾͗̆̏̌͘"̴̢͚̮̰̗̙̜̱̩̬͚̏̿͗̿̓̇̏̀͑̈́́̓̽̓̊̽̀̆̊̕͜͜͝ͅ|̵̡̡̻͔͇̺̮͖̳̮͓̣̖̫̓͂͆̑͘͜͝͝|̷̛̤͇̽̽̐͗͊̂͌"̴̛̺̜̠̠̩̟̠̙͙͈̥͚͙̺͌̂͊̉͛͊͒̿͋͂̈́̏̐͒͊̂̋̚͝,̴̛̤̙̫͓̜̣͔͉̪̻̜͂̏͑̓̍͋͜
̶͔͚̖̬̭̞͕͓̲̯̱̜̫̥̜̱̰̘̹́̈̅̈́̒̑̎̓̒͑͑̌̂͌͆̊̀̋͘̕͜͠͝ͅͅ ̴̨̡̱͎̟̳̟̼͗͗̂̚̚͝ ̸̣͓̞͕͍̖̠́̀ ̴̛̜̦̭̥̟̜̠͖͍̱̠̰̫̥̹̹̬̱͈͔̱͕̎́̔̐̔́͒̓̑́̃̈́̚͠͝ ̵̗̪͙̲̜̰̗̞̗͑̉ ̵̨̤̰͉̲̥̩͚̮̅̑́́́̉̀͒̅̈͗͆͑̍̇̽̈́̄̕͘͜͝͠ ̷̻̩̦̣̺̝̪̜̆̑̓̈́̉̽͜ͅ ̵̨̤̭̳̟͍̤̲̤̟͎̼̭͉͋̌͋͆̐̌̈̋̓̉̀̕̕͘ͅ ̷̻̜̼̪͉̇̀͆̈̀̆͑̉̒̀̒́̎̿͆̕̕͘͘͝ ̴̛̪̊̍̋͂̋͛̈̀̑̇̽̓̋̊̓͛̃̃͂̇͝ ̴̧̡̢̢̛̮͍̫͖̙͕̹̬̘̂̋̋̏̽̄͂͒̏̓̈́̑͛͑̇͘̕͝͝͝͝ͅͅͅ ̸̫̟̬̬̭̜̞̫̖͈͇̯̲͙̹̓̇ ̴̡̺̮͒́̇͛͒͌̒͝ ̸̨̢͈̺̥͓̞̪̀͐̂̇̏̽͛͐̎̿͒͘ ̵̧̡̛̬̙̳̙̥͙̗͎͖̟̫͍̼͖̠̬̭̬̬͗̉̽͗̋̍́͊̿̑̒̕͘͠ ̴͉̯̤̾̾͛͑́ ̷̢̰̝̦̞͍̝̠͂͋̐̂̄̈́͆͛̚ ̴̡̗͇̭̥̮̼̓̽͂͑͜ ̵̨̡̲̗͙͓̲̳̺̝͚̱͐̆̈́̽͊́̓̔͊͑̊́̈́̎͘͘ͅͅ ̸̢͕͎̼͇̥̤͈̱͔̹̫̟͉̗̖̳̟͚̮̲͑̍̅̍̓̈́̔̈́̀͒̂ͅ[̸̣̮͓̜̘̟̖̈͌̈́͑̽̂͌͋̔̂̌͐̄̅̀͝͠"̸̧̢̳̥̣͓̬̞̠̣̗̠̰̤̱̰̲̺̯͂̀̎́̂̄̅̒͋̔̾̃̒̈ͅͅi̶̧̡̖̠̫̰̫̲̙̱̥͚̰̓̂̒̂́̏͛̇͒̆͐͝ń̵̤͖̿̔̌̀̏̀͑̈́͆͐̚͠͝͠l̵̡̢̯͚̤̲͕͚̬̼̭̦̀͛͊ĭ̸̜͇͎͐̒̆̽́n̴̦̪͇̟̞͉̹̦̫̳͙͚̪͎̗̬̬͎̦͍̦͌̋͆̈̈́͠͠ę̸̨̢̛͖͖̱̘̞̲͖̙̟̀̇̆̃̏̽͒͘͠ͅͅ"̸̧̨̛̮̹͔̖̹͓͙͚͔̜̆͑̉̃̋̅̈̕]̵̨̢̝̞̪̭̹̰̩̭̤̫̼̘̙̜̥̐̌́̂͊̐̅̎̚͝͝ ̸̫̬̼̰̤̲̮̲͓̼̝̞̬̞͂͛̓̋̅̎͊͜͠ͅ≠̘̳̱͉͍̭̮͖͎͓̰̠̤͕̈͒͒ ̷̥̗̯͎̙̳̮̠͓̤̠͔̳͈̼͆͐̈͐̆̚͝ţ̷̢̛̣͉͉̭̀̈́̍̋̈̔̎̒̕͘ŕ̸̻͈̰͈̥̖̲͔̎́̓͒́̒̒́̏̑̎̇̿͊̚͝͝͝ͅu̴̡̢̙͎̺̳̱̼̝͉͙͉͓͙̗̣̤̙͋̈́̌̓̃͐̓̂͛̕ë̵̤̈́͊̒̿͛̾̍͑̽́̓̋̾͗͑̃̓͋
̸̺͈͖̇́̋̔̌͋͐̌̓̌̈̆̕͠ͅ ̸̹̠͖̪̖̀̈̓̐̉̐̊͐̍̄̾̀̌̕̕̕͠ͅͅ ̶̡̧̨̗̲̺̙͙̣̝̙̥̩̺̼̥̓̍̌̾͆͌͂̀́̊̐̄̕͝͝͝ ̶̢̛̦̗̬͍͎̄̈̈̍́̿̾̍͘͝ ̵͉̥̬̖̅̾̀̿̅̒̑͑͒̿̉̽͗̈́̚̕̚͘͝͝͝ ̷̩̞͐́ ̸̭̬̹̻̝͕̪̬̻̈́̌͗͌̓̂͊̅̋ ̸̛̝͐̿̀̒̍͋̒͗͛͐͑́̈́͋̈̈͆͠ ̸̨̨̦̟̲͚͔͓̟̖͚͖̙͙̣̜͖̭̥̺̑̇̂̈͌̓̀̊͌̽͋͊͐̂̋͆̚͜ ̷̖̟̤͇͕͉̝̟̲̘̖̭̝̉̓̍̋́͌̽͋̇̎̇ ̴̧̢̤̘̼͙͈͖̠̞̓̌̄ ̸̺͍́̂̿́ ̸͍̠͓̩̣̖̗̹̟̼̲̩̉͒̊̓͗̀̎̒̀̆̎͂̅̕͜͝ ̸̛̭̼̫̮̘̥̲̣̫̤̯̻̲̗͍͐̈̂̓̅̉͛̚͝ ̸̠̇̂́͑̐̉̚ ̸̡̰̟͕̟̤͇͖̈̊̆̂̊̔̎̎̈ ̴̛̛̜̞̞͕͇̞̹̲̩͖͚̭͙̩̺̮̻̺̫̆̎̈́̊̔̽͑̓̏̑̓̾̿̄͘͘͘}̴̛̛̦̞̦̠̩̠̼̜̻̳͍̣͇̮̻̞̞̊͐͋̾̓̉̍͆̓͂̔͗̓̈́͛͋͂̚͜,̴̖̯̥͙̳͈̘̞̮͍͎̺̗͍͉̭̘̆̽̑̂̓͊̏̈́͆͗̾̌̿̄̐̈́͊͊̇̕̕͘͜
