̶̛̛̛̠̖̩̗̟͍͎̖̗̙̬͎͉̥͇̠̗̮̓̾̉̂̂̈́̑̅̅͋̾̈́͘͜͝͝ͅ ̴̨̢̧̙̺̝͖̱̬̯̳͉͓̲̜̯̰̭̩̍̈ͅ ̵̗̪͎̺͆́̆͑̆͆̏̈́̑̈́͌́̉̉́͌͝͠ ̸̢̛̺̭͚̣͓͇͓͈͍͙̦̼͍͔͌̓̀͂̔̍̑̆͐̍̃́͋̓͘͠͝͠ͅ ̶̛̛̲͍̽̀͗̋͗͌͛̐̋͂̏̈́̑̅͠ ̵̨͚̮̼͎̝̬̦̣̟̻̯̑͜ ̴̛̛̛̲͓͍̺͖͋͑͐̔͐̄̾̓̄̇̈́̇͜͝ ̸̛̤̲̱̰̠̪̥̖̣̻̰͓̹͙̥̖͛̍̍́̀̓̈̇͌̑̊̃͛͌́͘͜ ̷̢͎͎͇̫̲̳̖̀̿͒̃̋͠ͅ ̸̢̩͉̅̽̏͐̒̐̄̽̈̉̈̌̍͑̎͠͝ ̷̝̩̻͌̀̀̉̀͗͌̉̋̾̀̈́̂̏͒̓́̂̕͠ ̴̛̳̩͚͕̹̲͔̖̹̬͓̯̠͈͒́̏̾̈́̀̃̈́́̃͜͠ ̶̡̡̡̥̬͇̺͓̪̯̃͂̑̀̌̂́̎̔͜͝ ̶̧̨̧̳̣͙̼͕͍̖̪̯̜͖̹̲̙̲͐̃̉̍̄͌̑̿͝͝ ̷̟̞̲̗̠̫͙͈̻̋̔͊́̒̈͆̕̕ ̴̡̛͈͇̳̅͂͌́̊̈́͆̈̔̓̚͝ ̴̨̜̬̦͚̜̟͈̰̭͙̩̎̀͗́̋̇̎̔͘ ̵̡͈̤̳̣̻̺͙̣̥̗̈́̈͋̌̎͒̈́̐̊̋͊͒͐̉̽̒͋̓̆̚͜͝͠ ̶̭̞͎̆̔̀̊̀̿̿̆̊̿̒̏̋́̕͘͘͝͝ ̶̥̹̮̭̦͎̲̪͙̺̝͔͗̈́̈̆̀́̈̑̓͒̈́̆͂̆̄͜͜͜͝͝[̵̧̡̧̛̰̟̪̻̤͕̦̳̹̱͉̞͎̪͕̬̎̃̅͊̈́͋̇̏̓̑̊͋̓̈́̚͜"̷̧̨̮̳̟͈̘̪̥͙͎̥̻͓̙͖̂̾̈́̾̓̾͐̋̐͗̇̒͊̕̕͝͠n̵̨̡̛̜̩͖͍͕͓̠̩͈͇̤̳̜̐̆̐́̑̑͐̾͛͌̒̇͑̇̏̐́̾͘͜͜ͅà̷͖̞̯̩͈̬͉̳̭̰̱̭̫̮̹͒̊͛̈͌̃͗̏̏̋̿̍̏͘m̴̢̢̥͔̹̖̝̟̰̖̙̝͔͒̎̂̉͒̈́͋́̚͝ę̸̨̥̲͖̥̠̝͓̻̼̞̇̅̀́̏̀̀̆̀̽̔̚͘͝͝"̵̛̫̉̈́̑̐̐̊͊̇̉̾̋̆͌͊̕͝͝]̷̡̧̧̻̙͔̏̅̈́̔͐̈̿̉̄̌̑͂̐͊̀̕͘͘͜͠͝ ̸̨̨̡̡͓͈͉̮͔̭̭̰̦̯̘̺̗̄̂̃̐͑̿́̌̏͐̄̑̈́͛̊́͘͜=̷̨̢̼̣͕͙̞͔̭̮̪̪̥͉̰̺̰̣͊̓̐̇̀̋̓͋͒̓͂͒̆͘̚ ̵̧̪̒̎͗̈͛̓̒̉̏̌̽͂̔̈́̆̓́̕͠"̴̳̍ا̷͖̗̬̙̜̱̀͐̇͂̊̂̿̾͆̈́̋͂̌́̿̋̃̅̚͜͜͠͠ل̶̧̛̘̘͕̖͕͕̤̼͛̉̈́̅̋̈́̈́̓̑̊̽͌̉̌̀̅̄͘͜͝͝ا̸̨̨̱͕͔̭͎̦͉̘̭̫̺̺̬͉̳̜͖̏̉̍̉̓͗͗͒̒͛͑͗̀̐̏̎͛̍͝ي̷̧̧̧̼͈̼̥̠̼̠̘̘̜͚̣̫̪̲̝͉͓͙̿̊͌̅͂̀͋͐͒̓͘̚͠د̵̧̪̼̻̝̤̭̣̼̝̌̆͐͂̃͋̆̎̇͊̽̀̄͊̇͘͜͝͝͠͠͝͝ي̴̼͉̙̲͚̞͓̒̂"̴̛͔͗̏͐͒̌̕,̷̡̮̮̥͉̳̳̳͉̩̹̒͊̐̃̎̍̽̍͐͌̆̈́͛͠
̷̛͔͙̝̟̪̱̮̻͎̿̊͊͊͛͋͆͑͘͠͝ͅ ̸͙̻̖̠̙̾̈́̎͑͗̓̏́͒̏̎̃̃͘͝ ̸̢̧̗̦̗̪͇̗͈̣̳̫͎̱̗̤͚͖̦̬̉̏͆̌ ̸̢̘͎͚͓̘̹̭͓͓͔̞͌̌͌̌̾̋͜͝ ̵̰͐ ̸̛̻͈͚̣͇̲̘͉͔̙̪̭̻̺̟͉̟͇͖̍͆̃̃͂̔̿͊̅̅͛̓͑̀̀̃̇͌͠ ̴̧̧̟̗̣̫̰͍͙̗̬̪̞͓͙̳̭̺̀̈̏̐̇̄̋̏̎̅͒͋̋̓ ̸̦̥͋̃͋̓͛͂̅̾͑́̑̃̈́̒́̿̓̂̕͜͠ ̵͈͔͚̳̈́̏̈́̊̆͗̊͘͠ ̵̢̧̥̗̬͈̻̟̟͈̪̝̖̣̻̠̤͇̫̞̹̊͌͆̈́̊͝͝ͅ ̷̨̨̨͉̤̝͇̜͕̭̪̟̫̹͚͈̹̳͙͇͊̎̂̓̄ ̶̨̬̱͈̟̫̹̘͙̮͖̺͐̅̂̎̇̓̎͛̿͘ ̶͈̲̦͋̔̀̂̈́̅̈́̃́̆̾̎͛̆͊ ̸̪͈̔̌̄͋͆̌̎̀̋̾͋̈́̈́̃͐̕͘͠ ̴̡̪̞̼̗̔̅̓̿̑̍ ̶̡͇̫̖̠̪̻̻̯̪̏ ̷̩̗͚̰̘̣̟̖̰̭̃͐͋̽̉̋̑̎͋̃͘̚͜͝͝ ̷͕̲̖͇̳̫̥̫̰̬̲̥͔͇̼͔̀̀́ ̵̛͈͛̂ ̶̢̠͉͉͖̭̎̒̊͘̚̕͜͝[̷͖̜͙͍̅͛̐́̚"̷͎̤̤̹͉̮̖̞̼̌̀̒͆́̉ͅv̸̢͉̪̼̜̹̗͕̙̠̳̻̇̒̽̎̈́͐̈̓̀͂̐͑̀̐a̴̢̛̟͓̤͓͔̞͒͒̾̾̀͋̂̎͊̄̃͗͊̏͛̈́̌̅l̵̢̧̨̩͉̳̜͚̫̥͇̮̜̝̽̀̈̈́̀̀̈̃͌̈u̶̧̢̨͕̟̰̖̩̮̬̖̲͎̠̗͙̮̍̂̌͜ẽ̸̡̨̡̱̬̘̺͚̲͙̦̟̩̮̖̦̒̌́̇͆̿̉͊͠"̶̨̧̡̛̯͇̺̤̯͔̹̽̇̀ͅ]̷̨̹̱̰͖̹̳͔͈̯͔̟̜̭̹͛͂̈͋̓͑̋̀̚̚̕ ̷̛͈͍̣͎̬̫̮̅͆̅̉̈́͛͆̂̃͝=̵̢̨̫̙̗̰̱̩̻̲̳̹͓̫̏̌͑ ̷̡̡̺̮̹͉̻͈̲̮̤̺̳̩̝̻̠̄̉͒̔͆͗̈́̌̈́͗̋͆̌̎̚͘͝"̶̡͙̼̰̞̔̆̆͋̎̑̓͆͌̂̈̈̿̊̏̚͠|̵̧̡͓̺͖̼͍͍̪̍̏̅͊̃͌͝͝͝͝͠|̴͈̬̖͍̊͂͋̔͛́̕[̸̛̜̗̈́́̈́̕"̶̢̧̨̛̛̜̟̗̲̱̱͇̮̤̥̹̣̗̣̼͎͑̌̈̄̈́̉͋̉̌̾̄̈́̀́͆͋̉͐́͝ͅ.̵̧͖̘̝̜̮̩̝̟͖͕̿̀̾̀̀̑͊̿͑͠.̶̯̘̲̲̟͇̥̤̰̮̫̮͕̠͋̑̍́̀̓͋̒͑̆̊̄̆͒̔̈͗̿̒͜͜͠p̷̨̥̐͛̊̏̈̎̂̾̔̅͐̉̀͆̕͝͠l̵̨͙͕̦͈̬͚̰͓̹̣̤͊͐̑͐͐́̑̎̂̏̌̆̂̔̄̄a̵̡̡̧̨̨̱̥̪̪̮̜͍͔͎͕̱̳̦̙͐̀̓̀̓̆͛́͜y̷̡̡̺̹͓̺͖̤̲̤͙̻̼̟̦͇̙͙͙̙̮͆͐̊͌̉̔̂̎̈́̾̊͑̌̊͠ĕ̶̻͍̤̫̥͙̓͐̈́̅̔́̏̄̈́̄̎̓̋͗̇̈̕ŗ̶̮͇̪̥̖̮̾͑̈́̋͋̂̾̋͊̐̾̓̄̈́̊͒͝͝.̵̟̻̇̀͛̎̌̃̅̈́̾̌̈́̋̚̚̕U̸̗͙̣͙̫͉̭̺̦̬͇̝̲͆̇̇̔̀̑̅͐̋͋̓́̔͘̚͠s̶̢̧̧̢̮̮̺̰̥̼̘̱̣̼͓̼̣̠͓̝̈̀̾̃͛́̿͂̂͐́̌̉̈́̐̏͂̈́e̷̡̢̠̺̥̥̘͍̦̠̣̯̘̳̅ͅͅr̶͍̉̒̒̃̏̐̽̒̉I̸̛̪̬͔̥͓̖̼͈̤͓͍͋d̴̺̜̼̤͚̯͙̗͖̯̬̬͉̝͂̑̈́͘.̵̨̢̧̡̭̯̠͈̟̝̬̰̻̤̪̦̹̻͎̳̅̈̀͜.̸̢͕̤̟̠̖̲̫̪̳̩͕̙̳̗̂̎̀͐̂̐̋̑̀͂̐͒͛̓̀́͗͜͝"̸̡͙̪̭̳̤̪̺̺̠̬̖̪̦̬́̐̑́̅̅͗̈́̅̎̽̾̒̈́͑̈̎͘̕͜͜͠͝]̸͕̜̱͖͉̯͖͇͙̫͚͒̀̒̈́̊͊̂̂͊̾̓̇͒̈́͗̄͑(̶̹̳̙͍̺͈̙̰̳̠͖̤̙̖̫̘̣̹̥͔̉͛́̑͌͗̀͝"̴̟͙̓͂̈̽͐̎̐͌̋̽̃̄̃̎̈̆̃̈́̕͝͠ ̵̢̤͍͍̦̠̤̙̤̲̓̔̇͒̇̄́̀̚̕.̸̡͎̥̪̲̼́.̵̨̥̟͕͓͇̗̤͉̜̃̾͘ ̵̛͔͈͊̆̑́̒̿̔͗́͑͐͐̃̅̿͂͛͐͌̚͝t̵̨̢̯̬͎̓̉̃͂̀͗̋́͗̌́́̄͝͝͝͝o̷̼͎̘̘͔̾s̶̡̝͚̲̟͕̼̬̆̔̓͒ͅͅt̴̢̧̨̨͓̳̳͎̗̰̝̤̰͎̜̲̲̒̑̌́̇̅̓͋̉̃̒̆̚͝ͅr̵̨͍͓̘̭̲͕̮͖͆̎̆̐̍͛̓̓̈́̉͐̈́͆̀̈́̋̒͗̈̅͜͝͠ĩ̸̧͖̬̠͍̘̓͒̚n̸̢̝͕̗͕̰̖͉̜̞͎͆̐̒̌͐̋̈́̒̀̇͆͑̃̽ģ̴̹̳̖̥̯͕̮̦̭͖̙̰̙͓̝̰̙͈̋͛̊͂͌̀̎͌̌̒̄̔͑̚͘(̷̡̙̺̥͈̜̜͊͂̓̋́͆̑̑͒͛̂͑̈́̄̈͌̐͘͠͠"̸̡̧͙͔̞̖̼̣̼̠͉̜̣͓̺̪͓̈́̀̿͊̉̇̇͛̍̃̊̈́͜͜ͅh̷̪̀̊̈́̋̀̇̾̔̈͠t̴͚̳͊͑͛̏͑̄́͑́͂̋̆ţ̵̰̙͈͔͙̹͈̭́́̐̀̿͆̈͐̒͆́͐̏͘̚͝ͅp̸̡̖̞̜̪̬͍͍͕̰̖̘̬̌͊̈̽̊͑͊̄͗̔̀̇̈́̕̚̚͝s̷̰̯̫͖̞͈̫̈́̌̓̎̒̌͒̋̈̇:̷̡̛͔̫̫̖͍́͗͂̒̈͜͝͠͝ͅ/̶̡͖͍̦̹̝̥̣͉̣͔̙̼͇̩͕͖̀̽̃͌̂̃͛̏͑͛̿͂͋̄̓̓̚͘̚̚͠/̵̨̢̢̲̟̺̠̦͓̥̖̣̞͕͓̝͇̝̝͔̲͔̽̆̈́̿̎͐̏̐̂͒̈͂̏͘w̴͎̮̖̪̖̙̫͈̳͕̲͓͙̪̘͖̰͈̜̻̖̅̂ͅw̵̡̨̧̨̫̳̙̠̜̦̟͓̰̭̮͈̹̝̝͗̐̑̌ẃ̵̦͊̀̔͑͋͂̊̈͊͊͘͠