̸̛̙̣̫̠̥̰̟͎̆̾͊̒̉ ̸̟̫̲͐̈̀͌̈͋̏͝ ̴͕̙̬͎̥̼͕͎̻͍̱͉̠̬̎̏̒̿ ̴̧̨̨̱͕̝̱̞̼̩͈̪͈̞͇̭̽̏̽͋̈́͆̐͒̾́̀̓̊͒̽́̊͝͝ ̸̡̢̠̩̫̥̗̖̪̜̹͙̫̖͍̤̬͎̤͌̉̾̄͑̒̂̋͊̅̊͋͒̿̕ ̷̡̛̠͔̖̱̺̱͎̱̟̠̤̗̥̣͙͎̖̳̳̣̺̇̃̚ ̸̨̲̥͚̣̰̹̣̯̀̈́́̎̓̏̓̂̆̅͝ͅ ̵̬̣̬̥̗̯̗̦͂̂̆̃͊̆ͅ ̶̛̤͖͇̿̊̑̄̂̍̋̍̈́̉́̂̆̾̓͘͠ ̷̡̨̛̛̫̰̣̦̱̖̤͚̹̖͚̘͍̤̠̜̼̿̀̋͋̍͜ͅ ̷̧͖̱̆͆́͆́̀͘͘͠ ̷̡̧̗͙̰͍̩͔̳̼̭̰̫̺̘̩̊̀̅͋͗̒̂͘͜ ̸̧͔͙̜̰̰̥̖͕̗̘͉͙͉͆̿́̐̄̀̀̽́̓͆́̎́̇͒͘̚ ̵̢̛̛̯̥̺̠̝̰̞͖̖̮͈̟͓̠͋͐̀͋̀́͆̽̀̚̕̚͠͝ ̶̨̢̪̝͖̱͎̣̙̠̺̣͖̙̤͍̼̺̭̦̏̆̒̈͘ͅ ̷̧̡̛̙̝̙̟̖̻͇͚̘͉͊͛̎̉̂͒͆͑̓̈́̔́́́̈́̐̉́̔̌̕ ̴̟̪̑̃̈́͑̒̐̿̈́̅̀̅͗͛͘̕͠͝ ̶̢͉̮͚̺̘̖̪̰̬̈́͆̍̔͝͝͝ͅ ̶̛̛̙͕̩̭̮̣͂́͑̍̐̅̊́͗̂̓̐́̅͗̕̕̕ ̴̡͓̉[̷̫̼̖͔̗̇̿̃̀́̍̈̓̀̈͂̉͝͝"̶̣̦̭͈̲͉̖̗̟͎̺̾̿̚n̶̡̡͉͙̮̣̠̖̯̝̺͙̞̹͈͇̺̫̩̈́̌̂̄̐̐̿̅͝a̷̡̡̨̬̭̲̮̪̟̠̩͕̺̙͇͚͕̽̅̐̿̀͛͋̂͜m̵̢̢̨̨͚̻̩̣͓͓̣͈̦̥͕̦͓̦̫̣̜̊̐͋̈́̑͂̅͝ͅȩ̵̢̧̢̢̰̼͎̘͎̼͚̬̰̘̘͔̭̝͑̒̓̆̀̊̇̋̑̉̈́͗̾̅̏́͗̒͝͝"̵͍̲͉͓̼̞̭̱̌̉̀̾̉̅̂̔͆́̑̈]̵̖͇̝͓̦̈́͑̊̈́͋̿̾̾̾̈́̔̉͊͠ ̵̛̰̮̮͐͋̓̈́̒̉̒͆͐́̄͘=̵̞͉̼̞̣̂͆̚͘ ̵̢̮͔͓̖̮͔̺̗͔̝̭̗͚̽̀͒"̷̹̹̥̖̫̘̬̗̻̂̈́̂́͗̀̄͑͂̒̋͌͘͜͝͝ا̴̨̤͔̟͈͍̬̫̬̋̿̾͂̈́̅͌͐͊̑̈̈́̀͗͜͜ͅش̷̢̧̨̧̡̧̲͕̘̪͓͉̱̖͍̗͔͕̭̫̥̊̎͛ͅت̷̲̥͖̞̗̰͚̬̥̦͙̾̔́̿͊̅̈́̀̉͑̃̀͐̉̽̌͛́̚̕͝ͅر̷̧̧̛͉̳̬͚͎͙̗̺͈̱̪̺͍̹̻̰̱̯̙̯̂͒͑̿̀́̈́̐̐͛͑͘ا̷̢̡̙̲̲̝̥̖͔̰̥͙̭̟̬̮͚͖͎͝ͅͅك̸̢̧̧̻̭͉̫͖̯̳̰͇̦̭̼̭̔̓̌̉̎̑̊̈̀̚͝͝ ̵̞̦̰͇̫̞̹̼͙̣͖̱̺̐̋̊̿̽̿̇̍̅̚̚͝ͅر̴̢̯͍̖̫̹͈̫̳͕͔̅̍̈́̈̀͐̏̓͌̅̅̅͂̋͊̈́͒͐̓̔̕͝و̸̢̩̣̯̯͓̻̩̪̻̮̔̀͜ب̷̢̨͓̣̰͙̳͍̲̖͇̪͕͕̭͈̺̔̏̅̌͜͜͝͠ͅ"̸̦̪̓͒͐̅̅͒̈́̄̎̓̈̎̏̌̓͌͐͠͝,̵̺̳̈́͊͗͗͘͠
̸̡̡̥̮̻͈̲͍̝͋̽̏̓̋̑̓̃͒̄͆̈́̄̈́͘͝ ̶̳͕̘̗̩͖͎̤̮̘̥̦̤̭̫͎͙̣̹͛̉̇͌͘ ̸̝̄̈́͆̆͛̎̽́͗̃̋͐̆̚̚̚ ̷̨̡̨̡͇̦͇͖̠͍̘͍͚̝͈̾̄̾̐̚͜͠ ̴̢͈̲͈̼͕̼̫̰̭̗̣͖̯̯͚͈̪̟̜̂̑̓͗̏̂̇̅̋̿͒͗̚͘̚ͅ ̸̛̻̘̙̩̳͓̖̮͓͉̤̭̩̯̖̹̾̏̾̑͑̋͛͑̔̑̿̐̓̈́̕̕ͅ ̷̱̈́̋̐̾̽̉̊͐͠ ̵̖͇͔̖̝̼͔̺̦̭̍͐̊̈́̎̑̓̆͂̈́̓̾͐̋͋̉̚͝͝ͅ ̶̢͙̳͍͉̱͙̲̗͍̟̱̝͚̱͓̪̝̓̌̌̈́̍̓̽̓̌͗̓̂́͝ ̶̨̭̪̤͈̞͙̠̺̙͕̣͈̐̈́̊̒ ̴̢͇̫̙̯͓̣̥̯̌̍͐ ̵̖̼͚͈̮̱̗̗̟̭̤̦͚̤̹͗̚͝ ̶̡̨̺̹̗̱͔͎͔̟̼̰̗̘͔͍̝͇͎̽̌̋̋̋̉̐̆̈́̌̿̕͘ ̸̧͒͛̆̅̓͗̈́̇̒͝ ̶̲̟̈́̅̒͗͌͒̎̾̈́̂͝ ̴͕͔̻͓̗̯̦͓͖̥̠̙̫̦̳̰̬̮̌͐͝ͅ ̵̡̝̜͇̟̪̞͎̫̹̩̝̫̫͗͒̈́̾̃́̏͂̾́͋͘̕̕͝͠ͅ ̶̢̡̟̥̤̙͉̮̫̫͖̮̥͖͓̺̇̃͂͌̈̿̽̓̔͗̃͗̄͗͑̈́̋̕͘͝͠ ̴̧̱̬̲̠̼̮̭̹̭͕̺̝͉̬͖̺̬̮̯̔̈́̋̿̽̋̃̓̕͝͝͝͠ͅ ̷̧͎͎̖̘̩̹̗̭̬̙̅͛̀́̒͌́̿͒̑̍̌͂͑̅̚̕̕͝͝[̶̛͎̱͓̫̥͔̭̈́̇̓͐̈̀̎̈́̏̈̎̑̀̉̓̚̕"̵̡̢̢̟̰̱͈͕̭̯̮̫͚̣̺̟̱̫̮͙̘͎̊͒̆͛̂͑̿͗͋̀̏̃̀͘͝͝͠v̸̧͎͙̰̻̦͖̗̝̯̰̇̓̎͛͂̑̈́̌̀̃̌̇̿̍͋̿͐̐̃̽̋͜ͅa̵̰̠̘̜̜͚̱̍̒̊̈̌͒͑̂̚͠l̴̨̠̠͉̦͖̭̩̜̼̞̻̮̫̰̙͚͓̟̮͐́̔͜͜ư̴̩͚͍̥̭͉͔̥̈́̉̆̔̉͐̈́͌́͌̈́͂̄̍̅̅̓̃̄͘͠ȩ̸͖̱̹͈͙̰̭͙͍̦̲͕̉̓́̇͑̏̿̒̐͌̕͜͝͝ͅ"̵̡̛͎͉̰̝̯̪̼̳̭̦̯̥̬͍͒̽͐̔͗̕̚͜͝͝ͅͅ]̷̻̮͓̥͍̫̤͔̤̇̽̈́̏́͐͘͝ ̵̡̛̛̫̲̺͇̯̙͒̃̀̉́̐́̈̄̐̕̚͠ͅ=̴̫̟̲̈́͑̒̍́̈́̒̓͑͆͐͘̕͠͝͝ ̸̡̡̻̱̗̳̜̣͙̻̺͑̓̏͑̎̇̀̅̽̃̃̓̚͘a̸̛̛͉͛̑̊͌̅̏̃̆̇̔͛̋ͅļ̷̨̧͓̥͇̲̭͕̟͓͇̯̮̔̔͛̈̕ẗ̶̢̛̛̹̫͈͍́̀̆̀̀̎̕͠͝͝͝,̷̡̧̛̻͙̹̤̘̞͓̝̗̪͒̍͆̈́̒̀̎͋̃͘͜͠
̴̡̻̠̹̮͓͍͉͕̝͕̦̩͉̟͓̼̠͚̮̇͑̓̉̌͂̋̏͋̈́̔̆̾̂̚͠ͅ ̶̡̦̰̙͓͕͝ ̸̨̡͎̹̺̰̮͈̮̟̳̤̟̼̰̞̫̺͖̋̇̈͗̈́̀͌̈́̏̄́̓͊̉̃͂̉́̎͘͜͝ ̵͙͍͉̣̄̋͋͆̄͒͆̈͠ ̷͕̩͉̿͌̒̌͂̈́͗͌̌͐̕͝͝ͅ ̵̢̨̧̟͍̞̼̘̤͖̱̖̙̓̌̀͊̓̒̽̀̈̍͆̍̿̂̋̃̉̕͝ͅ ̸̨̢̪͚̼͓̳̮͕̽̓̎́̽͛̇̄͆̀̚ͅ ̵̨͚̟̭͕̎̔̎͑̓̾̓̃́̑́̊́͊̄̎͌͝͝ͅ ̴̨͕̙̺͔̦̖̞̳̩̟͇̰̱͕̅͛͗͆͐̋̎ͅ ̸̧̗̱̖͕͓̦̯̞̤̙͓͍̲́̆̀̏͘ͅ ̷̢͇̟̮͓̟̣͔͓̠̰̠̹͚̺̠̘̻̬͈̩̽̏̄̔̎̽̀̎́͊̾̊́̔̎̓̐͋̅̚͝ͅ ̵͕̫̣͈̬͎̋̿̀̋̓̏͜͜ ̷̡̹͔̘̂̊͑̄̓̆̽̾̈́̌̅̀̎͊̚ ̵̧̢̣̰̫͖̥̩͓͚̪͕̺̗̓̄̊̓̓͊ ̸̼͓̪̼̩̩̖̯́͌̑͊̎̃̑͒̒̌͗̉͆͛́̀̚͘̕͠͝ ̷̨̨̧̱̝̤͕̠̗̙̱̞͗͜ͅͅ ̷̛̥̼̑̍̈́̍̈́͒̅̒̑̓̋͊͗͆̊̕ ̵̡̛̱̞̼̻̩̥̹͇̣͙̹̪͕̘̩͚̳͇̒̿̀̇̃̔̒̂͊̾͝ ̷̡̡̛̛̝̣̰͍͇̪͈̩̦̝͚̬̎̍͗͒̒̈́̊͛̾́̋́͋̈͝͠ ̶̧͓̪̠͍̾͒͊̏̈́͝͠͠[̴̤̞̙̱̜̩̫͛̇͆̓̄̈́̏͗̽̓͆͒͑͒́̾̅͝͠"̷̡̡̧̹̹̞̻̞̣̝̊̃͗͆̓̈̑͐͗͒̈́́̌͒͝ͅî̴͓̠͉ń̷̥̭̫͇͂͒̌͆̈͂̐̀̚l̴̨̢̧̪͈̭͉̖̗̰̹̥̘̦͕̳̱͛̒͂̔̄̃͋͑̋̋̾̉̈́̃̽̚i̵̧̳͍͖̥͍͉̗̲̙͙̇̓̊̒̓̈́́͊̇̂͋̂̊͋̽̈́͝͠n̵̨̖̥͔̱͓̜͚͎̯̯̼͇͙͑͋͗̓̂͊͘̕e̵̢̢̬̰͖̙͍̥̥̬̱̪̩̩̦̞͎͋͐͜ͅ"̷̧͖̯̹͙̣̝͈̹̩͕̫̬͇͕̂͗͑̀̈̾̒̀̌͆̓͑̕]̴̛̼̺̣͚̠̙͔̱͎͒̆̎̀̔͒̓͛͊̂́́̅́̃̍̄͑͘͘͝ ̶͙̳̄̎͛≠̧̡̛̛̞̺͓̟̩͙̹͎̺̲͚̼̺̳̘̜̙͔̺̬̀͗̈̇̾̏͐̓̅͐̚͝ ̸̨̡̡̢̨̘͚̫̥̟̙̮̘̥͉̘̥̩̣̙̭̹̀͛͑̽͊͛̄̍̇̀̄̈̾̓̕͝͠t̴̢̨̩̗̖͙̖̺̭̹͓̭̩̩̹͍̰̃̽̑̅̏͊͛̾̈̐̓̂̍̅̉̂̍̽̕̕͜͜ṛ̵̢̥̠̞̲͖͙̹̟͎̮̹͇̯̣̦̍̾̑̾̈͛͆̐̓̐̋̇́̆͆̂̾͂͂͋̚͜͜ͅư̵̡̢̨̛̤͔̩͔̗̥̱̗̣̜̦̜̦̱̝̣̐̓͂̉̉̂̒̌̅̌̃̊͆̆̊̽̅̇͆͜͝ȩ̷̡̢̧̧̛̛̦̪̠̜̣̟͓͓̻͍͐͊̃̏̀̒̍̉͗̕͜
̴̢̛̜̤̩̹̼̤͓̳̹̲̺̝̦̖͍͖͎̀̄̽́̀̈́̀̀̅͝ ̴̢̺̀̐ ̷̧̨̡̢̡̢̗̼̤̻̺̯̲̝̠̻̝̬͗̓̒̓͌̌͒́̎̑̋̇̀̈́̚̕͜͝͝ͅ ̷̧͎̘̗̣̰̜͙̼̖̱̭̾̔̌̽̒̏̍̒̀͑̾̑̐̈́̐͗̐̚͠ ̵̨̛͔̠̰̹̄̽͐͐̂͌́͌̓͐̓̊̇̾͂̔͒͝͝ ̴̨̡̩̤͍̣̠͎͍͓̥̎͗̋̍͊̿͆͌͒͒͑͂̀̽̀̇̕̚̚͠ ̸͉̀́̀̂̎̔͊̇͂̒̍̄̕̚͠͠ ̵̡̛̥̭̻̙͎̺̰̲̗͂́̈́̓̄̿̆͘͘͠ͅ ̵̛̹̫͉͙͙̜̳̠̰̟̦͎̯̜͇̙̟͉̯̺̒̓͗̋̽͋̿͊̓̀̀̄̏̑̅́͊̇̐̊͠ ̴͉͉̳͚͓͇̖͕̺̠̼͉̩͚̯̗͖̥̩̮̗̏̈́̀̋̕ ̵̛̬́̿̏͛͑͗̏́̀̄̔̌́̄͌̆̚̕͠͝ ̷̨̧̛̦͍̦͔̭̞̩̝͓͍̺̜̳̲̳̲̥̗̦̼̓̇̈́͌͗̋̂ ̸̲̰̜̝̺͋͌̂ ̶͍̞̰̤̘̦̜̙̮̻̼̅̈́͑͌́͛͂ ̷̧̠̲͈͓̠̜̼̭̥͓̤̲̼̥̘̪̤̪͌̄̂̔̀͂̉̈́̈́̀̏̍͑̔͛͌̏̍̅̽͘ ̸̻̪̦̰̖̻̰̭̰̳̙̝̙̟̋̍͛̊͋̓̍̋̀͆ ̴̨̳̰́̄͒̅͌̀͗̒̄̃́̈̈́̍̐̒̌͝͝}̶̭͙̤̦̮̝͇͈̲̝̺̳̹̖̳̬̲̀̉̏̉ͅͅ,̴̧̙͉̠͔̳͈̌
̴̨̼̹̞̭̫̜̩̈́ ̴̧̨̧̱̣̻͖̩͔̞͍͍͔̼̐̂̐͑̑̅̅͗́̇͛̒̚̚͝͝ ̵̡̨̨̨͔͓̭̘̳̹̖̙̳͑̐̓͊͆̎́̋͛̕͠ ̷͓̫͐̀̆̑̈́̽̀͒̌͑͌͝͝ ̷̛̛̛̝̭͔̹̠͈̺̿̐͑̓̋͐̄̕ ̷̗̰̲̤͓̎̔͒̔̒̎̐̓̾͌̎͑̈́̔̎͋̕̕ ̷̢͉̠͇̞͙̙̯̣̥̥̥̬̓͗̾́̎͆̊̈́̋̆͘͜ ̴̹̺͓͔̖͇͍̻̮̜̇̂̋̒̄͋͊̅̈͛͗͑̒͗̈́̐͘̕͝͠ ̶̢̨̛̻̠͔̼̮͖̹̙̥̗̼̘̥͍̟̈́́̓͑͋̅̎̿͆͐̒̽͜ ̷̤̭̲͉̘̳̭̝̦̑͆̿̅̊̽͌͋̿̀̋͐͒͌̐̅̐͠ ̷̧̡͙̙̤̩̟̳̜͖̹͇̭̯̼̇̍͊̉́̊̉̀͝͝ ̶̨̩͇͉̪̇͒͂̓̋̍̕ ̷̡̧̢̢̜̱̰͚̼̞͍̀̈́̇͒̐̐̈́̓̅́̕͠͝ ̵̧͎̺͎͔̝͕̗̲͈̖͕̝̂̒͛̅͒̈͜͜ͅ ̴̨̙̼̱̭͎͙̭̬̺̦̣̑͑͌͛̏̈́͒͒̈́̎̍͋͗̕͝͠ ̴̜͎̮̺͖͍̲̗̩͉̝̩͇͈͓͇̩͖̐̋͜ ̵̛̛̱̟̱̣̝̮͍͓̦̱̘̪͇̼̫͒̅͑̓̄̐̎̽̾̀̐̎̅͝{̴̳̲̗͍͉̪̻̭̙͍̭̦̹͊̿́̈́̅́̈̍͑̌̅͑̃͗̀̍͊̔̕͘̕͠
̸̡͇͓͎̝͍͓̹̗̘͛̉̈́͆̓͂͌̀̾ ̷̨̟̻͕̘̘̖̺̗͚̭͙̣̝̜̓̌͂͘͜ͅ ̵̛̫̪̗͍̟͍̻̝̫̤̦͇̺͇̱̆͑̄̌͂̐̈͜ ̸̧̰̳͐̈̎̓̄͊̓͆̒̉ ̷̢̧̥͚̥͍̲͉̺̱̹͕̱̞̭͎̝̜̬̽͗́̈́͆͂͌̽͂̋͊͝ ̵̖̺͌̎͊̑̋̈́̃̆̎̔̑̑͋́̚̕ ̵̛̠͉̦̪͙̘̹̭͈̾̌̐̽͆̄̅̄̇͐͆͑͘͠͝ ̴̡͉̣͔̗̫̻͈̼̇͛̉̈́̇̿́͐͆̈́̾̓͆̑̕͠ ̵̛̛̭͙̪͇͖̬̰̰͈̈́̆́͌͑̽͌̒͆̔̐̒̾͆̀͘͠͝͝ ̴̡̢̛̘̝̖̥͈̥̞̗͍̼͓̙͛̈́́̍͌̀̋̍͛͜͠ ̵̧̧̝̰̇̔̋̂̏̽͒̍̕͘ ̴̢̧͎̣͖̫͖̱͓̠͈̞̟͑͂̈́͆̓͑̍͐̎̀̐͂͂̀͒̐̂̅́̑̕̕ ̵̢̨̡̨̧̫̗͍̼̦͔͈̱̱̯̱̺̅̓̈́̅̂̇̉̈ͅ ̶̢̢̰̲̩̝̟͕̺̙͔̘̻͈̞̑̂̽̄͗̿̆́͑̚̕ ̸̥̲̰̰̖̼̘͓̗͚̞̙̳̣͚̦͋̀̅́̒́̉̈̀̈̽̈̓̀̀͌̅̓͜͝ ̵̡͇̬̬̫̯̤̫͈̂̆̓̏́͘͜ͅͅ ̸̢̖̳̯͕̗̻̩̖̰̬̜̘̺̹̣̆̿̐́̆̿̐͊͗̌͊͂͛͜ ̸̨͚̯̫͈̿̀́̈͌̈́̆̽̀̔͒̔̂̋́̚͠ ̷̡̛̮̯̞͓̫̭͉̘̮̗͑͌̐̒̃͗̓̈́͐̈́́̈́̍͗̑̔̂̐͐̔͜͠ ̴̲̣̣̙͖͈̮̪͍͍̾̆͜͝ͅ[̶̨̢̧̛͚̼̼͚̞͕̝̄̀̈́̑̅͊̅̾̿͗̅̃̋̊̚̚͠͝ͅͅ"̸̢̨̨̲̱͙͈̪̩͚̩̈́ͅͅņ̷̡̡̧̨͍̫̜͕̜̳̠̪̭͙̯̪̯͔͑̿͠ą̶̢̯̫̼͍̞͎̭̜͕̖͗̉̓́̊̍̏̉̌̀̈́̎͑̋͗̉̌̕̕͜m̴̥̓̂͛̈́͊̃̓̋̄̇͂̌͊̔̄͌̅̔͑̕͝ę̴̠̟̩̺͎̰̖͉̮̍͂̓̏̈̉̔͘"̵̨̦̣̻͕͈͇̤̰̉̐͆̇̊̆̀̐͆͆̆̒̽͒̊̚͝]̷̨̡̥͖̖͍̱̫̩̱̞̤̯̿̀͐͋̈́̈́̂̀͒̎̅̂̓͆̔̀̂͠͠ ̷̡̧̛̥̩̮̝̪̟̫̦͔̓̽̎̾͑͆̽̃͆͊̿́̈́͗́̃=̴̫̃̎̇́̓̐̆̍̌̅̈́̄̈ ̴̧̩͇̰̥͎͙̫͍̝̳̟̐͋͜͜͝"̵̧̻̣̣͎͇̬͇͇̺̬͖͆͂͌̀̊̑ͅͅع̶̼̖̭̰͕̈́̈́̉̂́̇̾͝م̶̛̭̏̿͑̀̈͂͊̔̌̍́̎̽̔̾͘͝͠ر̷̨͖͎̙̄̏̐̽̈̏́͜ ̶̧̢͕̼̭̐͌ا̷̝̉́͑͑̀͑͋͗̇͗͝ل̶͈̠̫̺̘͎̱̲̓̌͌́̋ح̵̧̗̹̌̈̐̓͋̀̋̀̀͊̈́̓̅̍̎س̶͚͈̙̜͐̇̊̑̍̉̈́̋͐̒̊̾̆̿̒̓̀̄̃͘͜ا̶̢̢̩̮͇̗̭̦̰̟̘̤̯̠͔̗̫̈͆̃́̀̅͊͐͘͜ب̵̟̼͖͕̈́̅̈́̏̇̚͝"̴̢̻̝͉̪̯̳̞̬͎̦͇͇͋̅̊̍̔̐͛̇͌͜͝,̷̨͍̮̠̙̱̝̿̉̑̕
̶̨͈͈͖̙͓̪̼̭͎̭̱̀̿̂͛̿͊͑͜͝͝͝͝ ̵̨̹̣̠̞̞̯̄̅͆̽̿̅͌̾̀̄̒̊͒̄͒̊͑̀̏̈́͘͜ ̶̋͜ ̴̧̭̰̦̝̠͕̞̮̱̬̭̯̱̔̔ ̷̯̰̹̗̿̃̾̅̋̂̉͗̄̊̎̏̚ͅ ̵̛͚͚͍̆͊́̍̅̅̓̐̂̓̾̆́̕ ̷̛̼̘͙̤͇̯̙͕͓̪̫̩̰͉̯̠̠̜͔̂͛͆͘͠͝͝ ̶̢̨̛̝̩̪̺̯̱̱̮̟̗͚̇͑̄̇̓̏̾́̇̉̍͊̐̕ ̵̨̤͓̫̭͓͍͇̆̈͜ ̸̢̲͓̝̋͐̆̔͐͗̿͒͋͊͗̔̀̾̕͜͠ ̵̮̗̹͍͈̙͙̮̰̣̪̲̱͔́̄̈́̓̇̎͂̏̑̑͜ ̴̰̒͊̋̏́̀̀̀͊̉̒͘͝ ̷̡̛̘͖͉̜̦̻̍̊͌̆̂̏̀̂̏́̕̕͝ ̷͙̥̪̰̏̓͒͛̈́͗͋͋͗̕͝ ̷̳̫͍͆̾̉̋̈́͊̍̽̐̌́̒͊͂̊̿͒ ̷̨̢̖̳̺̘̟̻͍̜̺̬̞̭͐̊̊̇̀̓͗̔͊͗̀̀̏̈́̅̃̚ͅ ̸̡̢̡̩̩̥͕̘̬͎͔̱͙͕̼̟̩̭͙̎̑͊̂̈́́̽̑̔̇́̏̇̔̋̋̂̓̕̕͝ ̸̜̤̱͌̂͘̕̚͝͝ ̸̧̰̺̜̞͕͇̈̈́̍̐́͛̃͐̋͜͝ ̸̡̨̨̗̲̞̣̤̳͕̬͔̳͍̖̺̠̖͓͊̅ͅ[̴̧͉̅͋̽͆̂̌̈́́́̀̇̏̾́͋̌͘"̶̨̧̭̼̹͔͇̥̀͑̀̈̎̋̽͋̑̊͋v̵̪̟̭͉͈̯̜̹͖̳͈͊̔ą̴̧̧̡̢̛͖̹͍͇͔͙̼̦̤̩̹̦̺̗̊̓̍̊͝l̸̜͓͛́́̅͋̾̚ͅų̷̬̤̘̟͉̲̦͉̣̯̙̩̣̙̠̲̟̹͈̀̾͌̚ë̷͎̠̗̱̙̜̞̲̫͓͚͎̦̤̜̃͋̿̾̾̆̂̏̅͆̂̓͂̂̃̂̚͘̚͝"̴̢̝͔̫̘͉͈̘͙̲͈͉̈́̓͑̈́̎͗͒͐̎̈́̏̅̈́̕͝ͅ]̵̨̛̛̯͈͉̦̘͎̹̣͙̆̇̈̎͗͗͊̀̓͐͗̄̿̀̋̿̆͘͝ ̶̨̨̰͖̬̠̺̥͕̥̻̱̱̜͉̭̘̗̠̾̈́͂̀͒̿͛̓̕̕͜͜͜=̷̛̛̯̦̠̤͚̖̫͙̭̝̦̌̓̏̎̓͒͊̄̃ͅ ̶̧̧̧̧̙̦̘͕̝̹̩̩̩̝̭̠̮̞̰̮̗̣̃̒̊̽̍̎̏̐͛̃̑͑̄̆͋̋͘͝͝p̵̨͕̣̰͍̲͓͔̞̯͈͕̃͐̔͠l̶̨̨̘̞̦̳̙̣̖͖̫̥̬͕͎̩̣̳͔̭̩̖̐̃́̀͆͋̃̓̅̎̌̀̀̀̓̽̓̓̅̅͝a̷̜̮̓̍͜y̶̧̛͔̰̟̲̜̌̂̆̀̽̾̃͆̑̑͐̈́͒͒̾̌̈́̉̎̾ę̵̨͎̳͙̗͕̫̪͙͍̦̪̭̙͚̦̘̺̪́͛̅̍̚͝ŗ̴̧̡̪̜̩̯̬̙̤̹̖̩̼̲̞͓̱͙̃̈͗͊̑̋̂̒̈̐͜.̶͇̘͛̂A̶͙̹̯̫̠̲͕̯͋̊͂ç̸̢̟̺͍̍ͅc̴̨̛̼̞̖̰͚̼̺͕̿̓̇̇͆͋͋̈́̄̈́̈́̂́̀͌͂̍͝͝͝͝ͅṑ̴̧͈̱̬̝͈̭̊̿̂̉̅̎̾̅̈́́͘͘͘̕̕͜ǚ̶̧̢̩͓̠̳͎̦͖̝̗̞̭̻̙̉͝͝n̶̛͓̼͒͛̌̿͋̽͌̋̾͠͝ṱ̸̗̲̟̪̯̮̣̩̝̞̣̙̓̈́̐̒͐̾̒͝͝Ą̵̧̢̛͉̞̰̼̼̙̻͔͙̝̣̱͓̩̞̤͕̃̋͛̋̄̕̕̕g̶̛̰͊͗͛̀͂̋̽̏̈͛̀̅́̌̽̆̀̉͘͝͝ę̵̩͍͓̤̥̺̹̈́̈́̃̔̈́̓́̎̓̂̊̆̇̅͘ͅ.̴̞̤̦̪̻͓͉̜͉̙̀̍̅́̈́̓̀͌̿̊̃̂̂͠.̴̨̜̦̱͎̲̭̙̤̫̯̹̘̪͚̤̯̤̣̻̤͆̀͆̏͗͘͘"̵̢̡̼͖͕̪͉̱̠̫͇̼̺̩̇̂͋̃̈͜͝͝͝d̸̛̼̬̘̏̋̈̿̎͌̓̾̓́͆̄͛̊͒̍̕̚͘͝ą̶̨̨̪̗͚̝͓̹̭̟̮̝̞̥͕̪̰͉̆͂̈́̽̚ͅy̸͉͕̩̺̮͙͌̃͐̋̿̉̅̋̋͋́́̈́̈́̋̎̇̿̀̚͝͠ͅ(̴̞̣̤̘͚͚͊̈̾̅͗̍̎̅̽̃͝͝s̵̪͕͖͒͗̅̉̾̆͝)̷̖̭̱͎̹͍̤̮̙̣͎͋̈́̀̊̄̀̀̈́͠"̷̛̛̰͉̫̳̲̖͙̬̇̓͊̀͊͊͋̎͌̒̈́͋̕͝͝͠͠,̷̡̨̛̳̯͍̩͎̳̺̱̳͉̭̙͎̤̦͕̈́̑͗̿̐̀̈́́̆̾͂̊̏̋͜͠͠͠ͅͅ
