̷̳̭̬͈͍͍͍̳̳̙̞̜̪̙͓̪̮̰̦͛̀͗̓̈́̽̇͝͝ ̶̝͑͊̍̋̌̈́̈̀̂͜ ̵̧̛͓̈́̉ ̴̜̝̜̙͓͓͙͔̼̯̹̘͉͉͓͓͊͐̎̚͠ ̵̡̢̤̯͔̼͔̦̙̥͈̳̬̲̲̞̖̎͊̆̈́̈́̑ͅͅ ̶̧̢̡̡̢̛͕̩̫̹͈̻̠̠̤̯̟͌̾̎̑̑̈́̌̏̽̅̓͂̎̈́̒̃̕͘͠͠ ̸̡̧̝͈̤̣͈̹͓͚̹͎̠̑͒̊̅̽̓͒͌ ̷͓̳̩͎̻̱̦͚̭͔̠͇̹̝͔̦̀͠ ̸̡̡̛̰͚̱͉̫̦̮͉͍̙͍͕͈̯͈̀̽̔̓̏̅̒͗̒̄͜ ̷̣͇̦̯̗̝͖̗̼̲̺̟̳̉͗̽͜ ̸̨̦͉̻͉̳̫̳̙̦̦̋͌̽͗́̾̿̋͘͘͝ͅ ̸̡̨͙͈͈̱̘̝͇̲̻̹͍̪̥̻̼͔̙̕̕ͅ ̶̢̯̤͔͈̦̝̜̰̪̭̭̝̝̊̿̽̓̐̉͘̚ ̵̢̧͖̲̯͉̙̱͍͔̹͙̲͍̱̭̞̪̭̦̜̊͐͒ ̶̻̓̅͂̓̏̒͊̽̓̀̀͌̅͐̂͂͐̕͝͝ ̷̙͇̣̲͎͍͕̭̄̔̍̓̌̆̂̓͜͜ ̶̨̧̛̺͕͖̰͎̭͕͓͖͓̱͔̰͔̊͊̇͛́͑͐͛̉̅͒͑̒̀̚̕͜͝͠͠ ̷̭̱̫̗̠̭̝̼̱̤͉̦͖̥̇̌̇́̂͂͗̚̕͜͜͝ ̷̢̬̩̰̺̼͙̻̩͓̭̫̩̣̩̭̓͆͗́̃̅̀ ̷̤̥̋́͆́̍̓̍̋̔̿͐͌̾͆̏̕[̷̮̥̟̗̪͕̖̂͐̿͑̽̈̅̔͌̆̾́̾̓̃̄̒̆͒̚"̴͇̪̖̺̺̭̱̗̠̀̌̿̐̅ͅi̵̢̨̜̯̜̬͎̺̲͇̼͓͈̺̤̫̊̏n̴̢̢̢̢̨̢̪̬̘͚̪̳͚̳̘̮̦̩͈͒̈̈̒͊͑̇́̇̿̅̃̈́̋̾͝ͅļ̶̫̙̮̺̯̫̱̜̹̳̥͙̈́̓̄͂̈́͂͆̕̚͜ͅi̷̟̙͍̤̬͚̟̹̤͕̜͛͗̌͌͌̌̄̾͠ņ̵̛͙̟͈̩͓͎̭͔͎͎̼̬̦̱̩̭̠̣̘͚̒͒͒͊̋́̈̿̋̐̉͋͗è̸̪͍͙̰̳̩̲̟̝̗̓͛ͅ"̵̧͔̞̫̭̘̯̠͖͉̼͚̉͂͐̔̽͐́̽͋̎̕̕͜]̶̨̨̺͖̣͖̱̤̱̜̮̄́̽̈́̀̅ ̴̢̟͇̜̬̬̯̟̖͎̗̙̮͚̲̳̔̃̐̔͌̿̃̾̒̾̈͆͜͜͝͝ͅͅ=̶̨̨̧̧̟͍͍͓̮̹͇̬͚͕̖̻̼͎͙̝͐͒̈̈́̄̓̅͑͑̂̊̈́̉͆̕͜ ̸̛̼̖̲̣̦̖̈́̂̉̽̀̾̆̉̆̏͆͋̑̅͑̔̕̕͘͝͠t̵̡̟͕̔̊͗̓̔̓́͐́̓͋̈́̒̆̕r̷̜͋̂̾̓̂̔̋͠ư̵̧̧͕̞͇̺͈̩̱̖̱̮̗̙̺̱̣̹̠̺̈́̆̃͊̐̑͌͗͘e̶̢̟͔͕̦̋̆̿͗̿̅̊̒
